class Dashboard extends Component {

	constructor(props) {
		super(props);

		this.state = {
			isLoading: true,
			error: null,
			stockData: [],
			finnhubData: [],
			watchlist: []
		};

		this.fetchDashboardInfo = this.fetchDashboardInfo.bind(this);
		this.fetchFinnhubData = this.fetchFinnhubData.bind(this);
	}

	componentWillMount() {
		this.fetchDashboardInfo();
		this.fetchFinnhubData();
	}

	fetchDashboardInfo() {
		fetch('/api/stock/watchlist', { 
			method: 'POST', 
			headers: { 
				'Accept': 'application/json', 
				'Content-Type': 'application/json'
			}, 
			body: JSON.stringify({ tickers: this.state.watchlist } )
			}).then(res => res.json()).then((json) => {
			if (json.success) {
				this.setState({
					isLoading: false,
					stockData: json.stockData
				})
			}
			else {
				this.setState({
					isLoading: false,
					error: json.message,
					stockData: json.stockData
				});
			}
		}).catch((err) => {
			this.setState({
				isLoading: false,
				error: err,
				stockData: []
			});
		});
	}

	fetchFinnhubData() {
		fetch('/api/stock/finnhub', {
			method: 'POST',
			headers: {
				'Accept': 'application/json',
				'Content-Type': 'application/json'
			},
			body: JSON.stringify({ tickers: this.state.watchlist }) 
		}).then(res => res.json()).then((json) => {
			if (json.success) {
				this.setState({
					isLoading: false,
					finnhubData: json.finnhubData
				});
			}
			else {
				this.setState({
					isLoading: false,
					error: json.message,
					finnhubData: json.finnhubData
				});
			}
		}).catch((err) => {
			console.log(err);
			this.setState({
				isLoading: false,
				error: err,
				finnhubData: []
			});
		});
	}

	onSubmitClick = () => {
		const ticker = document.getElementById('ticker-input').value.toUpperCase();
		if (ticker.length > 5 || !ALL_US_LISTINGS.includes(ticker) && !OTHER_LISTINGS.includes(ticker)) {
			console.log('Please input a valid stock ticker');
			document.getElementById('ticker-input').value = 'Invalid Symbol';
			return;
		}
		if (!this.state.watchlist.includes(ticker)) {
			this.setState({
				watchlist: [...this.state.watchlist, ticker.toUpperCase()]
			});
			document.getElementById('ticker-input').value = '';
		}
	}

	onRemoveClick = (ticker) => {
		this.setState({
			watchlist: this.state.watchlist.filter((sym) => sym !== ticker)
		});
	}

	render() {
		if (this.state.isLoading) {
			return (
				<div><p>Loading...</p></div>
			);
		}
		if (this.state.error) {
			return (
				<div style={{ backgroundColor: 'red' }}><p style={{ color: 'white' }}>{this.state.error}</p></div>
			);
		}
		return (
			<div className="pageContainer">
				<h2>Dashboard</h2>
				<p>Use the input form below to generate a watchlist of stock tickers: </p>
				<h3>Your Current Watchlist: </h3>
				<ol className="stockWatchlist">
					{this.state.watchlist.map((ticker, i) => (
						<div key={uuidv4()} className="watchlistRow">
							<li key={i} className="watchlistTicker"><p>{ticker}</p></li>
							<button key={ticker} className="deleteButton" onClick={() => this.onRemoveClick(ticker)}>DELETE {ticker}</button>
						</div>
					))}
				</ol>
				<p>Type a valid ticker submit and submit (i.e. 'AAPL', or 'SPY')</p>
				<input id="ticker-input" type="text"/>
				<button onClick={this.onSubmitClick} type="submit">Add Stock</button>
				<br />

				<h3>Now, Query Your Watchlist Data: </h3>
				<p>Once your specified watchlist is complete, submit below to generate alphavantage stock data 
				and daily chart visualizations. You may edit your watchlist contents and re-submit the alphavantage query as needed: </p>

				<button onClick={this.fetchDashboardInfo} className="sendWatchlist">Generate Stock Charts</button>

				<div>
					{
						this.state.stockData.map((data) => <StockInfo key={uuidv4()} data={data} />)
					}
				</div>

				
				<p>Additionally, you may submit your watchlist and gather Yahoo Finance info to pull fundamental data pertaining to the preselected list of symbols: </p>
				<button onClick={this.fetchFinnhubData} className="finnhubButton">Get Finnhub Earnings Data</button>

				<div>
					{
						this.state.finnhubData.map((data) => <EarningsInfo key={uuidv4()} data={data} />)
					}
				</div>
			</div>
		);
	}
}

export default Dashboard;